using System;
using System.Collections.Concurrent;
using Newtonsoft.Json;
using CS.Mmg;

namespace CS.Sdk.Services
{
    /// <summary>
    /// MMG service with hard-coded values for commonly-used MMGs. This
    /// service is not recommended for production use, only for development
    /// and testing purposes.
    /// </summary>
    public class InMemoryMmgService : IMmgService
    {
        private static ConcurrentDictionary<string, MessageMappingGuide> MMG_LOOKUP = new ConcurrentDictionary<string, MessageMappingGuide>();

        /// <summary>
        /// Gets a message mapping guide
        /// </summary>
        /// <param name="profileIdentifier">The profile identifier for the MMG</param>
        /// <param name="conditionCode">The condition code</param>
        /// <returns>Message Mapping Guide</returns>
        public MessageMappingGuide Get(string profileIdentifier, string conditionCode)
        {
            var sw = new System.Diagnostics.Stopwatch();
            sw.Start();

            MessageMappingGuide mmg = GetMmg(profileIdentifier);

            sw.Stop();

            return mmg;
        }

        private MessageMappingGuide GetMmg(string profileIdentifier)
        {
            MessageMappingGuide mmg = MMG_LOOKUP.GetOrAdd(profileIdentifier, (profileIdentifier) =>
            {
                var content = profileIdentifier switch
                {
                    string mmgBase64 when mmgBase64.Contains("Generic_MMG_V2.0") => "",
                    string mmgBase64 when mmgBase64.Contains("Pertussis_MMG") => "",
                    string mmgBase64 when mmgBase64.Contains("Varicella_MMG") => "",
                    string mmgBase64 when mmgBase64.Contains("Trichinellosis_MMG_V1.0") => "",
                    string mmgBase64 when mmgBase64.Contains("STD_MMG_V1.0") => "",
                    string mmgBase64 when mmgBase64.Contains("Babesiosis_MMG_V1.0") => "",
                    string mmgBase64 when mmgBase64.Contains("TB_MMG_V3.0") => "",
                    string mmgBase64 when mmgBase64.Contains("CongenitalSyphilis_MMG_V1.0") => "",
                    string mmgBase64 when mmgBase64.Contains("CongenitalSyphilis_MMG_V1.1") => "",
                    _ => throw new NotImplementedException()
                };

                string mmgJsonString = Common.Base64Decode(content);
                MessageMappingGuide mmg = JsonConvert.DeserializeObject<MessageMappingGuide>(mmgJsonString);
                return mmg;
            });

            return mmg;
        }
    }
}
